public boolean equals(Object other) {
  if (this == other) {
    return true;
  }
  if (other == null || !(other instanceof GetAllResourceTypeInfoResponse)) {
    return false;
  }
  return ((GetAllResourceTypeInfoResponse) other).getResourceTypeInfo()
      .equals(this.getResourceTypeInfo());
}
